// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Structs.sol";

library MediaLibrary {
    // sets the precision of the royalties and shares
    uint256 public constant SHARES_DENOMINATOR = 10000;

    function getRoyalties(
        Media memory _media,
        uint256 _amount,
        mapping(uint256 => ShareHolder) storage _collabs
    ) external view returns (uint256, Distribution[] memory) {
        uint256 fee = (_amount * _media.royalty) / SHARES_DENOMINATOR;

        return (fee, distributeAmountAmongCollabs(_media, fee, _collabs));
    }

    function distributeAmountAmongCollabs(
        Media memory _media,
        uint256 _amount,
        mapping(uint256 => ShareHolder) storage _collabs
    ) public view returns (Distribution[] memory) {
        Distribution[] memory distribution = new Distribution[](_media.collabsSize);
        for (uint256 i = 0; i < _media.collabsSize; i++) {
            ShareHolder memory current = _collabs[i];
            uint256 amount = (_amount * current.share) / SHARES_DENOMINATOR;
            distribution[i] = (Distribution({holderAddress: current.holderAddress, amount: amount}));
        }
        return distribution;
    }

    function getCollabIndex(
        Media memory _media,
        address _collabAddress,
        mapping(uint256 => ShareHolder) storage _collabs
    ) external view returns (int256) {
        for (uint256 i = 0; i < _media.collabsSize; i++) {
            if (_collabs[i].holderAddress == _collabAddress) {
                return int256(i);
            }
        }
        return -1;
    }

    function getOwnerIndex(
        Media memory _media,
        address _ownerAddress,
        mapping(uint256 => ShareHolder) storage _owners
    ) external view returns (int256) {
        for (uint256 i = 0; i < _media.ownersSize; i++) {
            if (_owners[i].holderAddress == _ownerAddress) {
                return int256(i);
            }
        }
        return -1;
    }

    function getCollabs(Media memory _media, mapping(uint256 => ShareHolder) storage _collabs)
        external
        view
        returns (ShareHolder[] memory)
    {
        ShareHolder[] memory collabsArray = new ShareHolder[](_media.collabsSize);
        for (uint256 i; i < _media.collabsSize; i++) {
            collabsArray[i] = _collabs[i];
        }
        return collabsArray;
    }

    function getOwners(Media memory _media, mapping(uint256 => ShareHolder) storage _owners)
        external
        view
        returns (ShareHolder[] memory)
    {
        ShareHolder[] memory ownersArray = new ShareHolder[](_media.ownersSize);
        for (uint256 i; i < _media.ownersSize; i++) {
            ownersArray[i] = _owners[i];
        }
        return ownersArray;
    }

    function getCollabsAddresses(Media memory _media, mapping(uint256 => ShareHolder) storage _collabs)
        external
        view
        returns (address[] memory)
    {
        address[] memory collabsAddressesArray = new address[](_media.collabsSize);
        for (uint256 i = 0; i < _media.collabsSize; i++) {
            collabsAddressesArray[i] = _collabs[i].holderAddress;
        }
        return collabsAddressesArray;
    }

    function getOwnersAddresses(Media memory _media, mapping(uint256 => ShareHolder) storage _owner)
        external
        view
        returns (address[] memory)
    {
        address[] memory ownersAddressesArray = new address[](_media.ownersSize);
        for (uint256 i = 0; i < _media.ownersSize; i++) {
            ownersAddressesArray[i] = _owner[i].holderAddress;
        }
        return ownersAddressesArray;
    }
}
